import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="section">
      <h2>Contact Me</h2>
      <p>Email: <a href="mailto:ramya999mr@gmail.com">ramya999mr@gmail.com</a></p>
      <p>Phone: 7032265676</p>
      <p>GitHub: <a href="https://github.com/ramya999mr" target="_blank" rel="noreferrer">github.com/ramya999mr</a></p>
    </section>
  );
};

export default Contact;
